    public static List<Integer> checkInclusion2(String s2, String s1) {
//        if (s1.length() >= 10000 || s2.length() >= 10000) return new ArrayList<>();
        if (s1.isEmpty() || s2.isEmpty()) return new ArrayList<>();
        if (s1.length() > s2.length()) return new ArrayList<>();

//        long[] s1Chars = new long[26];
        List<Integer> s1Chars = new ArrayList<>();

        for (int i = 0; i < s1.length(); i++) {
            int c = s1.charAt(i) - 97;
            if (i == 2000) {
                System.out.println(i);
            }
            if (s1Chars.get(c) != null) s1Chars.add(c, s1Chars.get(c) + 1);
//            s1Chars[c]++;
        }

        long[] s2Chars = new long[26];

        List<Integer> indices = new ArrayList<>();

        int left = 0;
        int right = 0;
        while (right < s2.length()) {
            char start = s2.charAt(left);
            char c = s2.charAt(right);
            int subStringLength = right - left + 1;

            s2Chars[c - 'a']++;

            if (subStringLength < s1.length()) {
                right++;
                continue;
            }

//            if (Arrays.equals(s1Chars, s2Chars)) indices.add(left);

            s2Chars[start - 'a']--;
            left++;
            right++;
        }

        return indices;
    }


    public static List<Integer> checkInclusion3(String s, String p) {
//        if (s1.length() >= 10000 || s2.length() >= 10000) return new ArrayList<>();
        if (p.isEmpty() || s.isEmpty()) return new ArrayList<>();
        if (p.length() > s.length()) return new ArrayList<>();

        int[] s1Chars = new int[26];
        HashMap<Character, Integer> pMap = new HashMap<>();
        HashMap<Character, Integer> sMap = new HashMap<>();
        List<Integer> indices = new ArrayList<>();

        for (int i = 0; i < p.length(); i++) {
            char c = p.charAt(i);
            char c1 = s.charAt(i);

            if (pMap.containsKey(c)) {
                pMap.put(c, pMap.get(c) + 1);
            } else {
                pMap.put(c, 1);
            }

            if (sMap.containsKey(c1)) {
                sMap.put(c1, sMap.get(c1) + 1);
            } else {
                sMap.put(c1, 1);
            }
        }

        if (sMap.equals(pMap)) {
            indices.add(0);
        }
        char c = s.charAt(0);
        sMap.put(c, sMap.get(c) - 1);

        for (int i = 1, j = p.length(); j < s.length(); i++, j++) {
            c = s.charAt(j);
            if (sMap.containsKey(c)) {
                sMap.put(c, sMap.get(c) + 1);
            } else {
                sMap.put(c, 1);
            }

            if (sMap.equals(pMap)) indices.add(i);
            c = s.charAt(i);
            sMap.put(c, sMap.get(c) - 1);
        }

        return indices;
    }


    public static List<Integer> findAnagramsUsingHashMap(String s, String p) {
        List<Integer> indices = new ArrayList<>();

        if (s.length() == 0 || p.length() == 0 || s.length() < p.length()) return new ArrayList<>();

        if (s.length() == p.length() && !p.contains(s.charAt(0) + "")) return new ArrayList<>();

        HashMap<Character, Integer> pmap = new HashMap<>();

        for (int i = 0; i < p.length(); i++) {
            char c = p.charAt(i);
            if (pmap.containsKey(c)) {
                pmap.put(c, pmap.get(c) + 1);
            } else {
                pmap.put(c, 1);
            }
        }

        int loopLength = s.length() - p.length();
        for (int i = 0, j = p.length(); i <= loopLength; i++, j++) {
            String substring = s.substring(i, j);
            HashMap<Character, Integer> submap = new HashMap<>();

            for (int k = 0; k < substring.length(); k++) {
                char c = substring.charAt(k);
                if (!pmap.containsKey(c)) break;
                if (submap.containsKey(c)) submap.put(c, submap.get(c) + 1);
                else submap.put(c, 1);
            }

            if (pmap.equals(submap))
                indices.add(i);
        }
        return indices;
    }

    public static List<Integer> findAnagramsUsingAscii(String s, String p) {
        if (s.length() == 0 || p.length() == 0 || s.length() < p.length()) return new ArrayList<>();

        if (s.length() == p.length() && !p.contains(s.charAt(0) + "")) return new ArrayList<>();

        List<Integer> indices = new ArrayList<>();

        char[] schars = s.toCharArray();
        char[] pchars = p.toCharArray();
        char[] base = s.substring(0, pchars.length).toCharArray();

        int pAscii = 0;
        int baseAscii = 0;

        for (int i = 0; i < pchars.length; i++) {
            pAscii += pchars[i];
            baseAscii += base[i];
        }

        System.out.println(pAscii);
        System.out.println(baseAscii);

        if (baseAscii == pAscii) indices.add(0);

        int loopLength = s.length() - pchars.length;
        for (int i = 1, j = pchars.length; i <= loopLength; i++, j++) {
            int beforeAscii = schars[i - 1];
            int afterAscii = schars[j];

            baseAscii -= beforeAscii;
            baseAscii += afterAscii;

            if (pAscii == baseAscii)
                indices.add(i);
        }

        return indices;
    }

    public static List<Integer> findAnagrams(String s, String p) {
        char[] pArray = p.toCharArray();
        int pLength = pArray.length;
        Arrays.sort(pArray);

        List<Integer> indices = new ArrayList<>();

        for (int i = 0; i < s.length() - pLength; i++) {
            char[] chars = s.substring(i, pLength + i).toCharArray();
            Arrays.sort(chars);

            if (Arrays.equals(chars, pArray))
                indices.add(i);
        }

        return indices;
    }

    public static List<Integer> findAnagram(String s, String p) {
        int length = p.length();
        int loopLength = s.length() - p.length();
        List<Integer> indexes = new ArrayList<>();

        for (int i = 0; i <= loopLength; i++) {
            String substring = s.substring(i, length + i);
            boolean isSubstring = false;
            for (int j = 0; j < substring.length(); j++) {
                if (p.contains(substring.charAt(j) + "")) {
                    isSubstring = true;
                } else {
                    isSubstring = false;
                    break;
                }
            }
            if (isSubstring)
                indexes.add(i);
        }
        return indexes;
    }

